import { Col, Container, Row } from "react-bootstrap";

function App() {
  const person = [
    {
      id: "1",
      name: "احمد محمد",
      date: "5 مساءا",
      img: "2.jpg",
    },
    {
      id: "2",
      name: "علي محمد",
      date: "4 مساءا",
      img: "1.jpg",
    },
    {
      id: "3",
      name: "عباس السيد",
      date: "2 مساءا",
      img: "3.jpg",
    },
    {
      id: "4",
      name: "عمران ابراهيم",
      date: "7 مساءا",
      img: "2.jpg",
    },
    {
      id: "5",
      name: "حمدي محمد",
      date: "1 مساءا",
      img: "1.jpg",
    },
    {
      id: "6",
      name: "احمد صلاح",
      date: "9 مساءا",
      img: "3.jpg",
    },
    {
      id: "7",
      name: "مؤمن توفيق",
      date: "3 مساءا",
      img: "2.jpg",
    },
  ];

  return (
    <div className="font color-body">
      <Container className="py-5">
        <Row className="justify-content-center">
          <Col sm="8" className="">
          لديك  {person.length} مواعيد
          </Col>
        </Row>

        <Row className="justify-content-center mt-3">
          <Col sm="8" className="">
            <div className="rectangel p-3 ">

              {person.length ?(
                  person.map((itme)=>{
                    return(
                      <div className="d-flex border-bottom my-2">
                      <img className="img-avatar" src={itme.img} alt="not fount" />
                      <div className="px-3">
                        <p className="d-inline fs-4">{person[0].name}</p>
                        <p className="fs-6">{person[0].date}</p>
                      </div>
                    </div>
                    )
                  })

              ):null}

            </div>
          </Col>
        </Row>

        <Row className="justify-content-center my-2">
          <Col sm="8" className="d-flex justify-content-between">
            <button className="btn-style p-2">مسح الكل</button>
            <button className="btn-style p-2">عرض الكل</button>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
